window.bookSummaryJSON = "<p><b>From renowned master of lovecraft-style horror Brian Lumley, comes</b><b><i> Necrosope II: Vamphyri!,</i></b><b> the second audiobook in the Necroscope</b><b><i>Â® </i></b><b>series.</b> </p> <p>Not the end of life, Harry Keogh discovered - and not the end of his battle against the terrible evil of vampires. In a secluded English village, Yulian Bodescu plots his takeover of the world. Imbued with a vampire's powers before his birth, Bodescu rules men's minds and bodies with supernatural ease. He is secretly creating an army of vampiric monsters, things that once were men but were now walking masses of destructive hunger! </p> <p>Harry Keogh, Necroscope, thought that the war with the vampires had ended with the destruction of Boris Dragasani - and of Harry's body! But the man who talks to the dead lives on, more powerful than ever, able to transport himself instantly to any spot on the globe and to speak mind-to-mind with both the living and the dead. </p> <p>Are Harry's new powers enough to defeat Yulian Bodescu and his legion of monsters - or will the vampire army overrun the living Earth?</p>"; 
